sap.ui.define(["sap/scholar/demo/model/formatter"],function(t){"use strict";QUnit.module("Formatter qunits");function e(e){return t.getFormattedFrequency(e)}QUnit.test("Should return formatted frequency text",function(t){t.strictEqual(e(null),"Not defined","Formatting for null value is correct");t.strictEqual(e("text"),"text","Formatting for other values is correct")});function r(e){return t.formatfrequencyState(e)}QUnit.test("Should return formatted frequency state",function(t){t.strictEqual(r(444),sap.ui.core.ValueState.Error,"Formatting of state is correct for value < 500");t.strictEqual(r(510),sap.ui.core.ValueState.Warning,"Formatting of state is correct for value < 520");t.strictEqual(r(600),sap.ui.core.ValueState.Success,"Formatting of state is correct for value < 620");t.strictEqual(r(700),sap.ui.core.ValueState.None,"Formatting of state is correct for value > 620");t.strictEqual(r(null),sap.ui.core.ValueState.None,"Formatting of state is correct for value null")})});